import Styles from './fim.module.css'
import git from './img/git.png'
import lk from './img/lk.png'
function Fimm(){
    return(
        <div>
            <img src={git}> Github </img>
            <img src={lk}>Linkedin</img>
        </div>
    )
}
export default Fimm
